import React from "react";
import { useSearchParams } from "react-router-dom";
import '../styles/pages-style/index-style.css';
import Header from "../Components/Header";
import data from "../data.json"

/*Recuperer l'id du logement de lurl*/

function AccomodationSheet() {
    
    const [searchParams, setSearchParams] = useSearchParams({});
      setSearchParams({ hello: "world"  });
      console.log(searchParams);

    return ( 
        <div>
        <Header />
        <div>
        {data.logements.map((logement) => (
            <h1 className="nameAccomodation" key={logement.id}>{logement.title}</h1>
        ))}
        </div>
        </div>
    )
}

export default AccomodationSheet;
